import Navbar from './Navbar';

const lang1 = ()=>{
  if(localStorage.getItem('lang') === 'en'){
      
      return LOCALES.English
  }
  else if(localStorage.getItem('lang')=== 'ru'){
      return LOCALES.Russian 
  }
  else if(localStorage.getItem('lang')=== 'uz'){
      return LOCALES.Uzbek
  }
  else{
      return LOCALES.Uzbek
  }
}
const App = () => (
  <div>
    <Navbar />
    <YMaps 

enterprise
query={{
  lang:'en_RU',
  apikey:'7acd9319-78e1-4abe-a6af-d64c62828777',
  
}}

options={{width:'100%'}}
>
<Map
  width='100%'

  defaultState={{
    center: [40.993599, 71.677452],
    zoom: 9,
    controls: [],
  }}
>
  <Placemark geometry={[40.993599, 71.677452]} />
  <GeolocationControl options={{ float: 'left' }} />
  <FullscreenControl />
  <SearchControl />
  <TrafficControl options={{ float: 'right'}} />
  <RouteButton options={{float:'left',bottom:'0'}} />
  <ZoomControl options={{ float: 'right' }} />
  <TypeSelector options={{ float: 'right' }}  />

</Map>
</YMaps>

  </div>
);
export default App;
